INSERT INTO `media_resources` VALUES (1,'LISTENING',NULL,'https://storage.cloud.google.com/lingo_media/ETS 2024 Test 1/1759056189759-ETS_2024_Test_1.mp3',1),(2,'LISTENING',NULL,'https://storage.cloud.google.com/lingo_media/ETS 2024 Test 1/1759056238454-ETS_2024_Test_1-Part_1-Question_1.png',NULL),(3,'LISTENING',NULL,'https://storage.cloud.google.com/lingo_media/ETS 2024 Test 1/1759056237043-ETS_2024_Test_1-Part_1-Question_2.png',NULL),(4,'LISTENING',NULL,'https://storage.cloud.google.com/lingo_media/ETS 2024 Test 1/1759056237481-ETS_2024_Test_1-Part_1-Question_3.png',NULL),(5,'LISTENING',NULL,'https://storage.cloud.google.com/lingo_media/ETS 2024 Test 1/1759056237481-ETS_2024_Test_1-Part_1-Question_4.png',NULL),(6,'LISTENING',NULL,'https://storage.cloud.google.com/lingo_media/ETS 2024 Test 1/1759056237481-ETS_2024_Test_1-Part_1-Question_5.png',NULL),(7,'LISTENING',NULL,'https://storage.cloud.google.com/lingo_media/ETS 2024 Test 1/1759056241245-ETS_2024_Test_1-Part_1-Question_6.png',NULL),(8,'LISTENING',NULL,NULL,NULL),(9,'LISTENING',NULL,'https://storage.cloud.google.com/lingo_media/ETS 2024 Test 1/1759056242283-ETS_2024_Test_1-Part_3-Question_62_64.png',NULL),(10,'LISTENING',NULL,'https://storage.cloud.google.com/lingo_media/ETS 2024 Test 1/1759056241670-ETS_2024_Test_1-Part_3-Question_65_67.png',NULL),(11,'LISTENING',NULL,'https://storage.cloud.google.com/lingo_media/ETS 2024 Test 1/1759056241688-ETS_2024_Test_1-Part_3-Question_68_70.png',NULL),(12,'LISTENING',NULL,'https://storage.cloud.google.com/lingo_media/ETS 2024 Test 1/1759056242780-ETS_2024_Test_1-Part_4-Question_95_97.png',NULL),(13,'LISTENING',NULL,'https://storage.cloud.google.com/lingo_media/ETS 2024 Test 1/1759056244485-ETS_2024_Test_1-Part_4-Question_98_100.png',NULL),(14,'READING',NULL,'Come to the Maxley Heights Center for Horticulture and learn how to create a beautiful, eco-friendly garden for your home or business. ------. We will teach you how to plant a rain garden, which is simply a shallow sunken garden ------. a special soil mix to filter pollutants from rainwater flowing from nearby roads and rooftops. These gardens can be landscaped with native plants and flowers. ------. , rain gardens are always beneficial to the local environment. Among other things, ------. Improve drainage and protect rivers and streams. To register, visit www.maxley-horticulture.org.',NULL),(15,'READING',NULL,'31 July Akwasi Dombo Fourth Avenue GA 105 Accra, Ghana Dear Mr. Dombo, Thank you for your ------ support in helping me to plan the opening gala for Tokyo\'s fashion week. The event was a huge success, and I was honored to work with you. I know that our attendees follow your work closely, and they loved the designs you contributed for this event. Your designs received a lot of ------. on social media. Shows like this will keep Tokyo on the map as a premier fashion centre. ------. I realize that the multiple delays made planning no easy task. The auction ------ our Young Designers Award program is coming up soon and I look forward to working with you on that as well. Sincerely, Asahi Ishioka Director, Japanese Guild of Fashion Designers',NULL),(16,'READING',NULL,'From: Patron Services <patronservices@menachinlibrary.org> To: Edgar Hughes <hughes88@villachesta.com> Subject: Card expiration date approaching Date: December 3 Dear Mr. Hughes, Please be advised that your Mena Chin Library card will expire one month from today. ------. Must be renewed if you intend to keep your membership for the coming year. ------. This can be done at the information desk at any branch location. ------. you decide to close your account, no action is necessary. Failure to complete your renewal by the ------. date will result in the expiration of your library privileges. If you have any questions about this notice, or about general library services, you may reply directly to this e-mail. Sincerely, Patron Services',NULL),(17,'READING',NULL,'April 7 Naomi Burwell 43 Waymire Road South Portland, ME 04109 Dear Ms. Burwell, I am Omar Ridha, the manager of Droplight Studio. ------. We offer a full range of photography services for real estate professionals like you. We take pride in composing interior and exterior shots that make a property look its best. Droplight Studio spares no effort in ------. superior digital images. ------. our professional-grade equipment, lighting, and staging techniques allow us to highlight the best features of a property. And once the photo shoot is over, every image ------. expert editing. All these services come standard in every package. Please visit our Web site to view our work as well as our pricing and scheduling information. We are happy to work with you to customize orders. Sincerely, Omar Ridha, Droplight Studio',NULL),(18,'READING',NULL,'STOP! PLEASE READ FIRST. Thank you for purchasing this item. As you do the unpacking, please verify that all components are included and place them in a safe area to avoid loss or damage. Assemble the item on a soft surface or on the flattened empty box. Follow the pictures and begin the assembly by placing the main part on its side. Never overtighten any screw or bolt, or you may damage the wood or hardware. Please visit our Web site to obtain maintenance tips and register your product for warranty coverage: www.indodelight.com.',NULL),(19,'READING',NULL,'We are asking all Winnipeg staff to keep a copy of this schedule at their desks as a quick reference tool for scheduling interoffice meetings. Whenever possible, please schedule these meetings during one of the underlined hours, that is, after 7:00 A.M. but before 11:00 A.M. Winnipeg',NULL),(20,'READING',NULL,'The Bryant Foyer is one of the premier event spaces in our area. Set on a hill, it has expansive windows that provide sweeping views of the adjacent botanical gardens and the river. Built in 1897, it was the home of the Francona Charitable Trust until its renovation just over a year ago. Today, the space can accommodate up to 200 guests and is ideal for wedding receptions, office parties, and panel presentations. With its marble floors, cathedral ceiling, and stunning artwork, the Bryant Foyer is the ideal location for your next gathering. The on-site restaurant, Antido\'s, caters our events and also operates as its own business. This farm-to-table restaurant, headed by chef Michaela Rymond, meets all dietary needs and has revolutionized the local food scene. Area residents known to plan far in advance to get a seat. To reserve the event space or to make a dinner reservation, give us a call at 216-555-0157.',NULL),(21,'READING',NULL,'Joan Chi (12:39 P.M.) Hello Mina. Are you almost finished with the field measurements? I\'m getting hungry. Mina Evers (12:40 P.M.) Sorry, Joan. I\'m afraid you and Ms. Lim will have to go to lunch without me today. There\'s a problem with the site coordinates. This is going to take some time. Joan Chi (12:51 P.M.) Oh no. Should we bring something back for you? Mina Evers (12:59 P.M.) Get me a chicken sandwich. Joan Chi (1:00 P.M.) Sure thing, Mina. See you in a while.',NULL),(22,'READING',NULL,'This season\'s excellent weather has yielded a substantial harvest of fruits and vegetables, in many cases more than growers may find buyers for. Those of you wishing to donate surplus produce to community organizations can do so by visiting Vosey Farm and Garden\'s Web site (www.vfgdn.org), where you will find our list of drop-off locations. If you need us to come to you instead, please contact us. We will reach out to one of the many independent truck drivers who have kindly volunteered to transport and quickly distribute your food donations to vetted groups that need it. Check our Web site for more information about this service as well as for insights into topics related to farming and gardening in the Northern Great Plains region.',NULL),(23,'READING',NULL,'The 2025 Harwood Music Festival',NULL),(24,'READING',NULL,'From: HR Department <hr@glenwoodcorp.com> To: All Employees Subject: Upcoming Safety Training Date: September 25',NULL),(25,'READING',NULL,'Office Relocation Update As part of our expansion',NULL),(26,'READING',NULL,'Notice to Customers Due to unforeseen circumstances',NULL),(27,'READING',NULL,'Join us for a webinar on the latest marketing strategies',NULL),(28,'READING',NULL,'READING',NULL),(29,'READING',NULL,'Memo To: All Team Members From: Sarah Kim',NULL),(30,'READING',NULL,'Announcement Due to ongoing construction',NULL),(31,'READING',NULL,'Green Thumb Workshop Join us for a hands-on gardening workshop on October 8',NULL),(32,'READING',NULL,'45931',NULL),(33,'READING',NULL,'We value your opinion! Please take a few minutes to complete our customer satisfaction survey at www.feedback.com. Your input will help us improve your experience. As a thank you',NULL),(34,'READING',NULL,'Market Trends Report  September 2025 This report analyzes the current market trends affecting our industry. Key findings include a 5% increase in demand for eco-friendly products and a shift toward online shopping. For detailed data',NULL);
